class ListingHostSpider(scrapy.Spider):
    name = "listing_host"

    def start_requests(self):
        self.url_generator = AirbnbListingURLGenerator()
        urls = self.url_generator.urls
        for url in urls:
            #print("Queueing first url: " + str(url))
            yield scrapy.Request(url=url, headers = self.url_generator.headers, cookies = self.url_generator.cookies, callback=self.parse)

    def parse(self, response):
        listing_url = response.url
        host_url = None
        host_name = None
        if "/plus/" in response.url:
            host_url = response.xpath("//div[@id='meet-your-host']//div[@class='_1nhfz2']//a/@href").get()
            host_name = response.xpath("//div[@id='meet-your-host']//div[@class='_1nhfz2']//img/@alt").get()
        else:
            host_url = response.xpath("//div[@id='host-profile']//div[@class='_e296pg']/a/@href").get()
            host_name = response.xpath("//div[@id='host-profile']//div[@class='_e296pg']/a/@aria-label").get()
        yield {'listing_url': listing_url, 'host_url': host_url, 'host_name': host_name }


